function delDomPart(part) { 
 var rootElement = dom.getDocumentElement(); 
 var sXPath = "//document/" + part; 
 var domFields = Packages.org.apache.xpath.XPathAPI.selectNodeList(rootElement, sXPath); 
 for (i=0; i<domFields.getLength(); i++) { 
 if (domFields.item(i) != null) { 
 var domEl = domFields.item(i); 
 domEl.getParentNode().removeChild(domEl); 
 } 
 } 
}

